import {
  SW_PLANETS,
} from '../actions';

const swPlanetss = ( state = {}, action ) => {
  switch(action.type) {
    case SW_PLANETS:
      return {
        ...state,
        name: action.name,
        rotationP: action.rotationP,
        diameter: action.diameter,
        climate: action.climate,
        gravite: action.gravite,
        terrain: action.terrain,
        surfaceWater: action.surfaceWater,
        population: action.population,
      }
      default:
        return state;
  }
}
export default swPlanetss;
